$(document).ready(function() {

  $('#product_form_kind').change(function() {
    var val = $(this).val();

    $('.upgrade-section').addClass('hide');
    $('.career-section').addClass('hide');

    if (val == 'upgrade') {
      $('.upgrade-section').removeClass('hide');
    } else if (val == 'adhesion') {
      $('.career-section').removeClass('hide');
    }
  });

});
$(document).ready(function() {

  function WithdrawSimulator($el) {
    this.$el = $el;
    this.$fee = $el.find('[data-fee-text]');
    this.$total = $el.find('[data-total-text]');
    this.withdrawalFee = parseFloat($el.data('fee'));
  }

  WithdrawSimulator.prototype.init = function() {
    var input = new AutoNumeric('[data-input]', AutoNumeric.getPredefinedOptions().commaDecimalCharDotSeparator)
    var feeText = new AutoNumeric('[data-fee-text]', AutoNumeric.getPredefinedOptions().commaDecimalCharDotSeparator)
    var totalText = new AutoNumeric('[data-total-text]', AutoNumeric.getPredefinedOptions().commaDecimalCharDotSeparator)

    var $this = this;

    $('[data-input]').on('keyup', function() {
      var val = input.get() || 0;

      var feeTotal = (val - $this.withdrawalFee).toFixed(2);
      var total = val - feeTotal;

      feeText.set(feeTotal)
      totalText.set(total)
    })
  }

  $('[data-withdraw-simulator]').each(function() {
    var $el = $(this);
    new WithdrawSimulator($el).init();
  });

});
$(document).ready(function () {

  var ZipcodeFill = function (zipcodeInput) {
    var thiz = this;

    $(zipcodeInput).blur(function () {
      var cep = $(this).val().replace(/\D/g, '')

      if (cep != '') {
        var validacep = /^[0-9]{8}$/

        if (validacep.test(cep)) {
          $('#user_district').val('...');
          $('#user_address').val('...');
          $('#user_city').val('...');
          $('#user_state').val('...');

          $.getJSON("https://viacep.com.br/ws/"+ cep +"/json/", function(dados) {

             if (!("erro" in dados)) {
                 //Atualiza os campos com os valores da consulta.
                 $("#user_address").val(dados.logradouro);
                 $("#user_district").val(dados.bairro);
                 $("#user_city").val(dados.localidade);
                 $("#user_city").trigger('change');
                 $("#user_state").val(dados.uf);
                 $("#user_address_ibge").val(dados.ibge);
             } //end if.
             else {
                 //CEP pesquisado no foi encontrado.
                 thiz.clearFields();
                 alert("CEP no encontrado.");
             }
         });
        } else {
          thiz.clearFields();
          alert("CEP no encontrado.");
        }
      } else {
        thiz.clearFields();
      }
    })
  }


  ZipcodeFill.prototype.clearFields = function () {
    $('#user_district').val('');
    $('#user_address').val('');
    $('#user_city').val('');
    $("#user_city").trigger('change');
    $('#user_state').val('');
    $('#user_address_ibge').val('');
  }

  $("[data-zipcode-input]").each(function() {
    new ZipcodeFill(this);
  })

});

